};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h2 {...{
      "id": "canal-pods-显示-ready-23"
    }}>{`Canal Pods 显示 READY 2/3`}</h2>
    <p>{`此问题的最常见原因是节点之间的 8472/UDP 端口没有打开。检查您的本地防火墙，网络路由和安全组。解决网络问题后，`}<inlineCode parentName="p">{`canal`}</inlineCode>{` pods 应超时并重新启动以建立其连接。`}</p>
    <h2 {...{
      "id": "nginx-ingress-controller-pods-显示-restarts"
    }}>{`nginx-ingress-controller Pods 显示 RESTARTS`}</h2>
    <p>{`造成此问题的最常见原因是 `}<inlineCode parentName="p">{`canal`}</inlineCode>{` pods 未能建立 overlay 网络。解决方法同上。`}</p>
    <h2 {...{
      "id": "无法创建-ssh-通道到节点，不能获取-docker-信息"
    }}>{`无法创建 SSH 通道到节点，不能获取 Docker 信息`}</h2>
    <p>{`碰到这个问题时，命令行工具会返回以下报错信息：`}</p>
    <pre><code parentName="pre" {...{}}>{`Failed to set up SSH tunneling for host [xxx.xxx.xxx.xxx]: Can't retrieve Docker Info
`}</code></pre>
    <p>{`触发这条报错信息的错误有以下几种，您可以按照实际情况排查。`}</p>
    <h3 {...{
      "id": "failed-to-dial-to-varrundockersock-ssh-rejected-administratively-prohibited-open-failed"
    }}>{`Failed to dial to /var/run/docker.sock: ssh: rejected: administratively prohibited (open failed)`}</h3>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`指定连接的用户没有访问 Docker 套接字的权限。可以通过主机日志或者运行命令 `}<inlineCode parentName="p">{`docker ps`}</inlineCode>{` 来检查:`}</p>
        <pre parentName="li"><code parentName="pre" {...{}}>{`$ ssh user@server
user@server$ docker ps
CONTAINER ID        IMAGE               COMMAND                  CREATED             STATUS              PORTS                    NAMES
`}</code></pre>
        <p parentName="li">{`在这种情况下，您可以切换为 root 用户处理，或使用非 root 用户管理 Docker，详情请参考 `}<a parentName="p" {...{
            "href": "https://docs.docker.com/install/linux/linux-postinstall/#manage-docker-as-a-non-root-user"
          }}>{`使用非 root 用户管理 Docker`}</a>{`。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`当使用 RedHat/CentOS 作为操作系统时，由于`}<a parentName="p" {...{
            "href": "https://bugzilla.redhat.com/show_bug.cgi?id=1527565"
          }}>{`Bugzilla＃1527565`}</a>{`，您不能使用`}<inlineCode parentName="p">{`root`}</inlineCode>{`用户来连接节点。您将需要为访问 Docker 套接字单独配置一个用户。参阅 `}<a parentName="p" {...{
            "href": "https://docs.docker.com/install/linux/linux-postinstall/#manage-docker-as-a-non-root-user"
          }}>{`使用非 root 用户管理 Docker`}</a>{`。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`SSH 服务器版本过低。套接字转发正常工作的前提条件是 SSH 服务器的版本不低于 `}<strong parentName="p">{`6.7`}</strong>{`，您可以在命令行中输入`}<inlineCode parentName="p">{`sshd -V`}</inlineCode>{`，查询主机上 SSH 服务器的版本，返回结果的样例如下：`}</p>
        <pre parentName="li"><code parentName="pre" {...{}}>{`$ nc xxx.xxx.xxx.xxx 22
SSH-2.0-OpenSSH_6.6.1p1 Ubuntu-2ubuntu2.10
`}</code></pre>
        <p parentName="li"><inlineCode parentName="p">{`SSH-2.0-OpenSSH_6.6.1p1`}</inlineCode>{`表示当前的 SSH 服务器版本是 6.6.1p10，低于 6.7。`}</p>
      </li>
    </ul>
    <h3 {...{
      "id": "failed-to-dial-ssh-using-address-xxxxxxxxxxxxxx-error-configuring-ssh-ssh-no-key-found"
    }}>{`Failed to dial ssh using address `}{`[xxx.xxx.xxx.xxx:xx]`}{`: Error configuring SSH: ssh: no key found`}</h3>
    <ul>
      <li parentName="ul">{`指定为 `}<inlineCode parentName="li">{`ssh_key_path`}</inlineCode>{` 的密钥文件无法被访问。确保指定了私钥文件（而不是公共密钥`}<inlineCode parentName="li">{`.pub`}</inlineCode>{`），并且正在运行`}<inlineCode parentName="li">{`rke`}</inlineCode>{`命令的用户可以访问私钥文件。`}</li>
    </ul>
    <h3 {...{
      "id": "failed-to-dial-ssh-using-address-xxxxxxxxxxxxxx-ssh-handshake-failed-ssh-unable-to-authenticate-attempted-methods-none-publickey-no-supported-methods-remain"
    }}>{`Failed to dial ssh using address `}{`[xxx.xxx.xxx.xxx:xx]`}{`: ssh: handshake failed: ssh: unable to authenticate, attempted methods `}{`[none publickey]`}{`, no supported methods remain`}</h3>
    <ul>
      <li parentName="ul">{`对于正在访问的节点，指定为 `}<inlineCode parentName="li">{`ssh_key_path`}</inlineCode>{` 的密钥文件不正确。请检查是否为节点指定了正确的`}<inlineCode parentName="li">{`ssh_key_path`}</inlineCode>{`，以及是否指定了与之连接的正确用户。`}</li>
    </ul>
    <h3 {...{
      "id": "failed-to-dial-ssh-using-address-xxxxxxxxxxxxxx-error-configuring-ssh-ssh-cannot-decode-encrypted-private-keys"
    }}>{`Failed to dial ssh using address `}{`[xxx.xxx.xxx.xxx:xx]`}{`: Error configuring SSH: ssh: cannot decode encrypted private keys`}</h3>
    <ul>
      <li parentName="ul">{`如果要使用加密的私钥，则应使用`}<inlineCode parentName="li">{`ssh-agent`}</inlineCode>{`来用密码加载密钥。如果在运行`}<inlineCode parentName="li">{`rke`}</inlineCode>{`命令的环境中找到`}<inlineCode parentName="li">{`SSH_AUTH_SOCK`}</inlineCode>{`环境变量，它将自动用于连接到节点。`}</li>
    </ul>
    <h3 {...{
      "id": "cannot-connect-to-the-docker-daemon-at-unixvarrundockersock-is-the-docker-daemon-running"
    }}>{`Cannot connect to the Docker daemon at unix:///var/run/docker.sock. Is the docker daemon running?`}</h3>
    <ul>
      <li parentName="ul">{`在已配置的`}<inlineCode parentName="li">{`address`}</inlineCode>{`和`}<inlineCode parentName="li">{`port`}</inlineCode>{`上无法访问该节点，有可能是因为这个节点因为某些原因停止了运行，导致无法方位该节点，请重启该节点，然后再重新访问。`}</li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
